import React, { useState } from "react";

export default function Products({ addToCart }) {

  const [products] = useState([
    {
      id: 1,
      name: "Nike",
      price: 24,
      description: "Lorem ipsum dolor sit amet, consectetur adipisicing elit. Amet numquam aspernatur!",
      image: 'data:image/jpeg;base64,',
      ratting: 3
    },
    {
      id: 2,
      name: "roadster",
      price: 345,
      description: "Lorem ipsum dolor sit amet, consectetur adipisicing elit. Amet numquam aspernatur!",
      image:'data:image/jpeg;base64,',
      ratting: 3
    },
    {
      id: 3,
      name: "fasttrack",
      price: 984,
      description: "Lorem ipsum dolor sit amet, consectetur adipisicing elit. Amet numquam aspernatur!",
      image:'data:image/jpeg;base64,',
      ratting: 3
    },
    {
      id: 4,
      name: "onepluse",
      price: 145,
      description: "Lorem ipsum dolor sit amet, consectetur adipisicing elit. Amet numquam aspernatur!",
      image:'data:image/jpeg;base64,',
      ratting: 3
    }
  ])

  return (
    <>
       {
            products.map((product , idx) => (
                <div class="col-lg-4 col-md-6 mb-4">
                <div class="card h-100"  key={idx}>
                    <a href="#!"><img class="card-img-top" src={product.image}  alt={product.name} /></a>
                    <div class="card-body">
                        <h4 class="card-title">{product.name}</h4>
                        <h5>${product.price}</h5>
                        <p class="card-text">{product.description}</p>
                    </div>
                    <div class="card-footer"><small class="text-muted">★ ★ ☆ ☆ ☆</small>
                        <span>
                            <button className=" my-btn btn btn-xs btn-outline-primary"  onClick={() => addToCart(product) }>Add Cart</button>
                        </span>
                    </div>
                </div>
            </div>  
            ))
        }
    </>
  );
}